  const [questions, setQuestions] = useState([
    {
      questionId: "1",
      questionDetail: "What is encapsulation ?",
    },
    {
      questionId: "2",
      questionDetail: "What is method overloading ?",
    },
  ]);

  useEffect(()=>{
    fetchQuestion();
  },[])

  const fetchQuestion =async()=>{
    const res =await fetch("https://localhost:8443/onlineexam/control/findAllQuestions");
    const data = await res.json();
    
  }

  

  
  return (
    <>
      <MainContent text={"Questions"} to="add-questions" back="/admin/questions" />
      <AccordinMaker objects={questions}  id={"questionId"} name={"name"} />
    </>
  );
};

export default Questions;
